import React from 'react';
import { FiAlertCircle } from 'react-icons/fi';
import { FaArrowLeft } from 'react-icons/fa';
import { MdKeyboardArrowDown ,MdKeyboardArrowUp } from 'react-icons/md';
import {HiOutlineTag} from 'react-icons/hi';

import ImgMicrosoft from '../../assets/images/microsoft.png';

import Input from '../../components/inputs/index';
import Footer from '../../components/footer';
import HeaderEmpresa from '../../components/headerEmpresa';
import FotoAviso from '../../assets/images/Aviso.svg';
import Button from '../../components/Button';

import '../../global.css';
import './style.css';
import ModeloVaga from '../../components/ModeloVaga';

function VagasEmpresa() {
    return (
        < >
            <HeaderEmpresa />
            <div className="meio">
                <div className="top">

                    <div className="arrowdois">
                        <FaArrowLeft color="black" size={24} />
                    </div>

                    <div id="head">
                        <h1>Seu perfil</h1>
                        <h1>Suas vagas</h1>
                    </div>
                    <div id="linhanav"></div>
                </div>


                <div className="Offvagas">
                    <div className="separar">
                        <img src={ImgMicrosoft} alt="" />
                        <h1>Titulo da vaga </h1>
                    </div>
                    <MdKeyboardArrowDown />
                </div>

                <div className="Onvagas">
                    <MdKeyboardArrowUp/>

                    <div className="separar">
                        <img src={ImgMicrosoft} alt="" />
                        <h1>Titulo da vaga </h1>

                        <div className="areadavaga">
                            <HiOutlineTag/>
                            <span>Area da vaga</span>
                        </div>
                    </div>  

                



                </div>

                    <ModeloVaga/>
            </div>


        </>
    );
}

export default VagasEmpresa;
